var title_f5_15_5364="Retrocolic Roux-en-Y gastric bypass";
var content_f5_15_5364=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F70745&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F70745&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Retrocolic Roux-en-Y gastric bypass",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 450px; height: 526px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The Roux-en-Y retrocolic gastric bypass configuration is characterized by a small (less than 30 mL) proximal gastric pouch divided and separated from the stomach remnant, with drainage of food to the rest of the gastrointestinal tract via a small gastrojejunal anastomosis and a Roux-en-Y small bowel arrangement. The small intestine is divided at a distance of 30 to 50 cm distal to the Ligament of Treitz and a proximal biliopancreatic limb is created to transport the secretions from the gastric remnant, liver, and pancreas. The Roux limb (or alimentary limb) is anastomosed to the new gastric pouch and functions to drain consumed food. The cut ends of the biliopancreatic limb and the Roux limb are then connected 75 to 150 cm distally from the gastrojejunostomy.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Jones DB, Schneider BE, Olbers T. Atlas of Metabolic and Weight Loss Surgery. Cine-Med, North Woodbury, Connecticut 2010. Copyright &copy; 2010 Cine-Med.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
